export const Contact = (props) => {
    const { reach } = props;

    return (
      <>
        {reach.map((item) => (
          <div>
            <h2>{item.type}</h2>
            <ul>
              <li>
                <a href={item.link}>{item.name}</a>
              </li>
            </ul>
          </div>
        ))}
      </>
    );
  };
  export default Contact;
